import './NotificationChip.css'

function NotificationChip({ data }: any) {
    return (
        <div className='notification'>
            <img className="notification__avatar" />
            <div className="notification-content">
                <p>{data.senderType}</p>
                <p className='notification-content__highlight'>{data.action}</p>
                <p>{data.targetType}</p>
            </div>
        </div>
    );
}

export default NotificationChip
